import {
    BrowserRouter,
    Routes,
    Route
    // Navigate,
    // Outlet
} from "react-router-dom";


import LoginMain from "./components/LoginMain";

export default function MyRoutes() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/loginmain' element={<LoginMain />} />
       
      </Routes>
    </BrowserRouter>
  )
}
